window.bookSummaryJSON = "<p><b>Mighty beastkin. Sovereign tribes. Dangerous dragons.</b></p> <p>For Chod and company, Mythos just got a whole lot bigger.</p> <p>After making a name for himself on the isle, Chod has set out for new kingdoms. Each portal brings its own unique challenges, with powerful threats and deadly monsters, but most importantly, potential allies.</p> <p>Tasked with completing a difficult quest for the dwarven king, the barbarian summoner is determined to prove his worth, not just for the good of the forest trolls, but for all of Mythos.</p> <p>Under-leveled and far from home, Chod will have to use his wits as well as his muscles to survive in these strange lands. All the while, enemies lurk in the shadows. Willing and waiting to strike when he least expects it.</p>"; 
